import {React, useEffect} from 'react';

const NotFound = () => {
    useEffect(() => {
        document.title = "Page Not Found";
    }, []);
    return (
        <>

                <div className='m-5 position-absolute top-50 start-50 translate-middle'>
                    <h2>ERROR-404</h2>
                    <h5 className='m-auto'>Page Not Found</h5>
                </div>

        </>
    );
};

export default NotFound;
